CREATE TABLE incidents (
    id INT PRIMARY KEY,
    incident_date DATE,
    location VARCHAR,
    description TEXT
);
CREATE TABLE victims (
    id INT PRIMARY KEY,
    incident_id INT,
    victim_name VARCHAR,
    victim_age INT,
    gender VARCHAR
);
CREATE TABLE support_services (
    id INT PRIMARY KEY,
    service_name VARCHAR,
    description TEXT,
    location VARCHAR
);
CREATE TABLE organizations (
    id INT PRIMARY KEY,
    org_name VARCHAR,
    org_type VARCHAR,
    contact_person VARCHAR,
    contact_number VARCHAR
);
CREATE TABLE reports (
    id INT PRIMARY KEY,
    incident_id INT,
    report_date DATE,
    reporter_name VARCHAR,
    description TEXT
);
